import React, { Component } from "react";
import PhoneRepair from "../PhoneRepair/phoneRepair";

import styles from './phoneRepairMain.module.css';




class phoneRepairMain extends Component {





    render () {
        const phoneRepair = this.state.Data.map((item, index) => {
            return <PhoneRepair key={index} img={this.state.img[index]} model={item} />
        })

        return (
            <div className={styles.Main}>
                {phoneRepair}
            </div>
        )
    }
}

export default phoneRepairMain;
